import { Login, Home, RegisterPage } from './componets';

export const ROUTES = [
    { path: '/create', component: AccountEditor },
    { path: '/edit/:accountId', component: AccountEditor },
    { path: '/search', component: AccountsDashboard },
    { path: '/', component: Login }
]
